import React, { useState, useEffect } from 'react';
import './TopNav.css';

const TopNav = ({ onOpenMenu }) => {
  const [isSticky, setIsSticky] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      if (window.scrollY > 50) {
        setIsSticky(true);
      } else {
        setIsSticky(false);
      }
    };

    window.addEventListener('scroll', handleScroll);
    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, []);

  return (
    <nav className={`top-nav ${isSticky ? 'sticky' : ''}`}>
      <div className="nav-container">
        <div className="menu-icon" onClick={onOpenMenu}>
          <span className="line"></span>
          <span className="line"></span>
          <span className="line"></span>
          <span className="line"></span>
        </div>
        
        <div className="logo">
          <a href="/">
            <span className="logo-text">KABOUL GOURMET</span>
          </a>
        </div>
        
        <div className="nav-links">
          <div className="nav-item">
            <a href="/" className="nav-link">Home</a>
          </div>
          
          <div className="nav-item">
            <a href="#about" className="nav-link">About</a>
            <div className="nav-dropdown">
              <a href="#our-story" className="dropdown-link">Our Story</a>
              <a href="#chef" className="dropdown-link">Our Chef</a>
              <a href="#reviews" className="dropdown-link">Reviews</a>
            </div>
          </div>
          
          <div className="nav-item">
            <a href="#menus" className="nav-link">Menus</a>
            <div className="nav-dropdown">
              <a href="#lunch" className="dropdown-link">Lunch Menu</a>
              <a href="#dinner" className="dropdown-link">Dinner Menu</a>
              <a href="#weekend" className="dropdown-link">Weekend Special</a>
            </div>
          </div>
          
          <div className="nav-item">
            <a href="#private-dining" className="nav-link">Private Dining</a>
            <div className="nav-dropdown">
              <a href="#gallery" className="dropdown-link">The Gallery</a>
              <a href="#terrace" className="dropdown-link">The Terrace</a>
              <a href="#exclusive" className="dropdown-link">Exclusive Hire</a>
            </div>
          </div>
          
          <div className="nav-item">
            <a href="#contact" className="nav-link">Contact</a>
          </div>
          
          <div className="nav-item booking-link">
            <a href="#book" className="nav-link">Book Now</a>
          </div>
        </div>
      </div>
    </nav>
  );
};

export default TopNav;
